import React from 'react';
import {Link} from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: 'black'
    };

  return (
    <div>
      <nav>
          <h3>Logo</h3>
          <ul className="nav-links">
              <Link style={navStyle} to="/About"> 
                <li>About</li>
              </Link>
              <Link to="/weather" style={navStyle}> 
                <li>Weather</li>
              </Link>
              <Link to="/wave" style={navStyle}> 
                <li>Wave</li>
              </Link>
          </ul>
      </nav>
    </div>
  );
}

export default Nav;
